import React from 'react';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';
import { Toaster } from 'react-hot-toast';
import { AuthProvider, useAuth } from './context/AuthContext';
import Sidebar from './components/Sidebar';
import Login from './pages/Login';
import Register from './pages/Register';
import Dashboard from './pages/Dashboard';
import Groups from './pages/Groups';
import Expenses from './pages/Expenses';
import Settlements from './pages/Settlements';
import './index.css';

function ProtectedRoute({ children }) {
  const { user, loading } = useAuth();
  if (loading) return <div style={loadingStyle}><div style={spinner} /></div>;
  if (!user) return <Navigate to="/login" replace />;
  return (
    <div className="app-layout">
      <Sidebar />
      <main className="main-content">{children}</main>
    </div>
  );
}

function PublicRoute({ children }) {
  const { user, loading } = useAuth();
  if (loading) return <div style={loadingStyle}><div style={spinner} /></div>;
  if (user) return <Navigate to="/dashboard" replace />;
  return children;
}

function AIInsights() {
  return (
    <div style={{ padding: 32 }}>
      <h1 style={{ fontFamily: 'var(--font-display)', fontWeight: 800, fontSize: 30, color: 'var(--text-primary)', marginBottom: 8 }}>
        âœ¦ AI Insights
      </h1>
      <p style={{ color: 'var(--text-muted)', marginBottom: 32 }}>Powered by intelligent expense analysis</p>
      <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fill, minmax(320px, 1fr))', gap: 20 }}>
        {[
          { icon: 'ðŸ“Š', title: 'SPENDING_ALERT', msg: 'Your food expenses are 32% higher than last month. Consider cooking at home more often.', color: 'var(--warning)' },
          { icon: 'âš¡', title: 'PAYMENT_DELAY', msg: 'Priya tends to pay late. Consider sending a reminder before the due date.', color: 'var(--danger)' },
          { icon: 'ðŸ’¡', title: 'SAVINGS_TIP', msg: 'Split the Netflix subscription equally to save â‚¹150/month per person.', color: 'var(--success)' },
          { icon: 'ðŸŽ¯', title: 'BUDGET_INSIGHT', msg: 'Your trip expenses are on track. You\'ve spent 68% of your planned budget.', color: 'var(--accent)' },
        ].map((insight, i) => (
          <div key={i} className="card" style={{ position: 'relative', overflow: 'hidden', padding: 24 }}>
            <div style={{ fontSize: 32, marginBottom: 12 }}>{insight.icon}</div>
            <div style={{ fontSize: 11, color: insight.color, fontWeight: 700, marginBottom: 8, letterSpacing: '0.5px' }}>{insight.title}</div>
            <p style={{ color: 'var(--text-secondary)', fontSize: 14, lineHeight: 1.6 }}>{insight.msg}</p>
            <div style={{ position: 'absolute', top: -20, right: -20, width: 100, height: 100, borderRadius: '50%', background: `radial-gradient(circle, ${insight.color}15, transparent)`, pointerEvents: 'none' }} />
          </div>
        ))}
      </div>
    </div>
  );
}

const loadingStyle = {
  height: '100vh', display: 'flex', alignItems: 'center', justifyContent: 'center', background: 'var(--bg-primary)',
};
const spinner = {
  width: 40, height: 40, border: '3px solid var(--border)', borderTop: '3px solid var(--accent)',
  borderRadius: '50%', animation: 'spin 1s linear infinite',
};

export default function App() {
  return (
    <AuthProvider>
      <BrowserRouter>
        <Toaster
          position="top-right"
          toastOptions={{
            style: { background: '#16161f', color: '#f0f0ff', border: '1px solid #2a2a3a', fontFamily: 'var(--font-body)', fontSize: 14 },
            success: { iconTheme: { primary: '#00d4aa', secondary: '#16161f' } },
            error: { iconTheme: { primary: '#ff6b6b', secondary: '#16161f' } },
          }}
        />
        <style>{`
          @keyframes spin { from { transform: rotate(0deg); } to { transform: rotate(360deg); } }
          @keyframes fadeUp { from { opacity: 0; transform: translateY(20px); } to { opacity: 1; transform: translateY(0); } }
          .app-layout .navItem:hover { background: var(--bg-card-hover); color: var(--text-primary); }
        `}</style>
        <Routes>
          <Route path="/login" element={<PublicRoute><Login /></PublicRoute>} />
          <Route path="/register" element={<PublicRoute><Register /></PublicRoute>} />
          <Route path="/dashboard" element={<ProtectedRoute><Dashboard /></ProtectedRoute>} />
          <Route path="/groups" element={<ProtectedRoute><Groups /></ProtectedRoute>} />
          <Route path="/expenses" element={<ProtectedRoute><Expenses /></ProtectedRoute>} />
          <Route path="/settlements" element={<ProtectedRoute><Settlements /></ProtectedRoute>} />
          <Route path="/ai-insights" element={<ProtectedRoute><AIInsights /></ProtectedRoute>} />
          <Route path="/" element={<Navigate to="/dashboard" replace />} />
        </Routes>
      </BrowserRouter>
    </AuthProvider>
  );
}
